
.MODEL compact
.STACK 64
clearWholeScreen MACRO
	                 mov ah, 0
	                 mov al, 3
	                 INT 10H  	;FOR VIDEO DISPLAY
	ENDM
    editDrawPrams MACRO shape, sizeX, sizeY, offsetX, offsetY
	              MOV AX, sizeX
	              MOV shapeSizeX, AX
	              MOV AX, sizeY
	              MOV shapeSizeY, AX
	              MOV AX, offsetY
	              MOV shapeOffsetY, AX
			
	              LEA SI, shape
	              MOV AX, offsetX
	              MOV shapeOffsetX, AX
ENDM

displayMainMenu MACRO
	                call          background
	                mov           Ers, 0
	                mov           REV, 0

                    editDrawPrams gamebtn, btnsize, btnsize+2, gamebtnOffset, gamebtnOffset +2
	                call          drawShape_ex
	                call          drawGameBtn

	                call          drawChatBtn
	                call          drawExitBtn
	                call          drawLogo
	                call          eraseArrows
	                add           arrowoffsetY, arrowStep
	                call          eraseArrows
	                add           arrowoffsetY, arrowStep
	                call          eraseArrows
	                sub           arrowoffsetY, arrowStep
	                sub           arrowoffsetY, arrowStep
	                              

	                mov           Rev, 1
	                editDrawPrams ship1, shipSizeX, shipSizeY, arrowOffsetXRev, arrowoffsetY
	                call          drawShape
	                mov           Rev, 0
	                mov           AX, arrowOffsetX
	                mov           shapeOffsetX, AX
	                Lea           SI, Ship1
	                call          drawShape
	ENDM
checkMainMenuOptions MACRO gameLoop_label, exitProg_label                                       		; remember to add the chatLoop_label
	                     local CheckInMainMenu, Make_THE_JMP_CLOSER, downArrow_label, enterKey_label
	CheckInMainMenu:     
	                     mov   ah,0                                                                 	;  ah:al = scan code: ASCII code
	                     int   16h

	                     cmp   ah, key_upArrow                                                      	; up arrow
	                     jne   downArrow_label
	                     cmp   arrowoffsetY, arrowAtgame
	                     je    CheckInMainMenu
	                     call  eraseArrows
	                     mov   AX, arrowStep
	                     SUB   arrowoffsetY, AX
	                     mov   Rev, 1
	                     Lea   SI, Ship1
	                     mov   AX, arrowOffsetXRev
	                     mov   shapeOffsetX, AX
	                     mov   AX, arrowoffsetY
	                     mov   shapeOffsetY, AX
	                     call  drawShape
	                     Lea   SI, Ship1

	                     mov   Rev, 0
	                     mov   AX, arrowOffsetX
	                     mov   shapeOffsetX, AX
	                     call  drawShape
	Make_THE_JMP_CLOSER: jmp   CheckInMainMenu

	downArrow_label:     cmp   ah, key_downArrow                                                    	; down arrow
	                     jne   enterKey_label
	                     cmp   arrowoffsetY, arrowAtExit
	                     je    CheckInMainMenu
	                     call  eraseArrows

	                     mov   AX, arrowStep
	                     ADD   arrowoffsetY, AX
	                     mov   Rev, 1
	                     Lea   SI, Ship1
	                     mov   AX, arrowOffsetXRev
	                     mov   shapeOffsetX, AX
	                     mov   AX, arrowoffsetY
	                     mov   shapeOffsetY, AX
	                     call  drawShape
	                     Lea   SI, Ship1
	                     mov   Rev, 0
	                     mov   AX, arrowOffsetX
	                     mov   shapeOffsetX, AX
	                     call  drawShape

	                     jmp   Make_THE_JMP_CLOSER

	enterKey_label:      cmp   ah, key_enter                                                        	; enter
	                     jne   Make_THE_JMP_CLOSER                                                  	; added to prevent other buttons from doing enter's action

	                     cmp   arrowoffsetY, arrowAtChat
	;je gameLoop
	                     cmp   arrowoffsetY, arrowAtgame
	                     je    gameLoop
	                     cmp   arrowoffsetY, arrowAtExit
	                     je    exitProg
	                     jmp   Make_THE_JMP_CLOSER
	ENDM

